import React from 'react';
import Navbar from '../include/Navbar';
import Homeslider from '../include/Homeslider';
import About from './About';

const Home = () => {
    return(
        <>
        <Navbar />
        <Homeslider />  
        <About />           
        </>
    );
}

export default Home
